    true,nt"url": null,nt"notes": "This dataset provides personal income estimates
    and per capita personal income estimates for the State of Iowa by calendar quarter.
     Estimates for personal income available starting in 1948.  Estimates for per capita
    personal income available starting in 2010.  Thousands of dollars, seasonally adjusted
    at annual rates.  All dollar estimates are in current dollars (not adjusted for
    inflation).rnrnPersonal income consists of the income that persons receive in return
    for their provision of labor, land, and capital used in current production as well
    as other income, such as personal current transfer receipts. In the state and local
    personal income accounts the personal income of an area represents the income received
    by or on behalf of the persons residing in that area. It is calculated as the sum
    of wages and salaries, supplements to wages and salaries, proprietors' income with
    inventory valuation (IVA) and capital consumption adjustments (CCAdj), rental income
    of persons with capital consumption adjustment (CCAdj), personal dividend income,
    personal interest income, and personal current transfer receipts, less contributions
    for government social insurance plus the adjustment for residence.",nt"license_title":
